import{_ as e,o as a,c as t,O as r}from"./chunks/framework.9482e208.js";const f=JSON.parse('{"title":"§ 55.1-2509 Unclaimed demutualization proceeds.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/55.1-2509.md","filePath":"vacode/55.1-2509.md"}'),i={name:"vacode/55.1-2509.md"},o=r('<h1 id="§-55-1-2509-unclaimed-demutualization-proceeds" tabindex="-1">§ 55.1-2509 Unclaimed demutualization proceeds. <a class="header-anchor" href="#§-55-1-2509-unclaimed-demutualization-proceeds" aria-label="Permalink to &quot;§ 55.1-2509 Unclaimed demutualization proceeds.&quot;">​</a></h1><p>Unclaimed property payable or distributable in the course of the demutualization of an insurance company is presumed abandoned five years after the earlier of (i) the date of last contact with the policyholder or (ii) the date the property became payable or distributable. The report filed on November 1, 2003 will include demutualization distribution property for which there has been no policyholder contact for the five years prior to June 30, 2003.</p><p>2003, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?031+ful+CHAP0750" target="_blank" rel="noreferrer">750</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?031+ful+CHAP0765" target="_blank" rel="noreferrer">765</a>, § 55-210.4:2; 2019, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?191+ful+CHAP0712" target="_blank" rel="noreferrer">712</a>.</p>',3),n=[o];function l(c,d,s,p,u,h){return a(),t("div",null,n)}const m=e(i,[["render",l]]);export{f as __pageData,m as default};
